CREATE TABLE metrics
(
    id integer NOT NULL,
    name character varying NOT NULL,
    abbreviation character varying NOT NULL,
    created_at timestamp without time zone NOT NULL DEFAULT now(),
    CONSTRAINT metric_pkey PRIMARY KEY (id)
) TABLESPACE pg_default;

CREATE TABLE relationships
(
    id integer NOT NULL,
    name character varying NOT NULL,
    abbreviation character varying NOT NULL,
    created_at timestamp without time zone NOT NULL DEFAULT now(),
    CONSTRAINT relationship_pkey PRIMARY KEY (id)
) TABLESPACE pg_default;

CREATE TABLE projects
(
    id uuid NOT NULL DEFAULT uuid_generate_v4(),
    name character varying,
    created_at timestamp without time zone NOT NULL DEFAULT now(),
    CONSTRAINT project_pkey PRIMARY KEY (id)
) TABLESPACE pg_default;

CREATE TABLE project_properties
(
    id uuid NOT NULL DEFAULT uuid_generate_v4(),
    project uuid NOT NULL,
    name character varying NOT NULL,
    value character varying NOT NULL,    
    CONSTRAINT project_properties_pkey PRIMARY KEY (id),
    CONSTRAINT project_fkey FOREIGN KEY (project) REFERENCES projects(id) ON DELETE CASCADE
) TABLESPACE pg_default;

CREATE TABLE tests
(
    id uuid NOT NULL DEFAULT uuid_generate_v4(),
    project uuid NOT NULL,
    name character varying NOT NULL,
    created_at timestamp without time zone NOT NULL DEFAULT now(),
    CONSTRAINT tests_pkey PRIMARY KEY (id),
    CONSTRAINT project_fkey FOREIGN KEY (project) REFERENCES projects(id) ON DELETE CASCADE
) TABLESPACE pg_default;

CREATE TABLE test_properties
(
    id uuid NOT NULL DEFAULT uuid_generate_v4(),
    test uuid NOT NULL,
    name character varying NOT NULL,
    value character varying NOT NULL,    
    CONSTRAINT test_properties_pkey PRIMARY KEY (id),
    CONSTRAINT test_fkey FOREIGN KEY (test) REFERENCES tests(id) ON DELETE CASCADE
) TABLESPACE pg_default;

CREATE TABLE test_sets
(
    id uuid NOT NULL DEFAULT uuid_generate_v4(),
    project uuid NOT NULL,
    name character varying NOT NULL,
    CONSTRAINT test_tests_pkey PRIMARY KEY (id),
    CONSTRAINT project_fkey FOREIGN KEY (project) REFERENCES projects(id) ON DELETE CASCADE
) TABLESPACE pg_default;

CREATE TABLE test_set_properties
(
    id uuid NOT NULL DEFAULT uuid_generate_v4(),
    test_set uuid NOT NULL,
    name character varying NOT NULL,
    value character varying NOT NULL,    
    CONSTRAINT test_set_properties_pkey PRIMARY KEY (id),
    CONSTRAINT test_set_fkey FOREIGN KEY (test_set) REFERENCES test_sets(id) ON DELETE CASCADE
) TABLESPACE pg_default;

CREATE TABLE test_set_tests
(
    id uuid NOT NULL DEFAULT uuid_generate_v4(),
    test_set uuid NOT NULL,
    test uuid NOT NULL,    
    CONSTRAINT test_set_tests_pkey PRIMARY KEY (id),
    CONSTRAINT test_set_fkey FOREIGN KEY (test_set) REFERENCES test_sets(id) ON DELETE CASCADE,
    CONSTRAINT test_fkey FOREIGN KEY (test) REFERENCES tests(id) ON DELETE CASCADE
) TABLESPACE pg_default;

CREATE TABLE items
(
    id uuid NOT NULL DEFAULT uuid_generate_v4(),
    project uuid NOT NULL,
    name character varying,
    created_at timestamp without time zone NOT NULL DEFAULT now(),
    CONSTRAINT items_pkey PRIMARY KEY (id),
    CONSTRAINT project_fkey FOREIGN KEY (project) REFERENCES projects(id) ON DELETE CASCADE
) TABLESPACE pg_default;

CREATE TABLE item_properties
(
    id uuid NOT NULL DEFAULT uuid_generate_v4(),
    item uuid NOT NULL,
    name character varying NOT NULL,
    value character varying NOT NULL,    
    CONSTRAINT item_properties_pkey PRIMARY KEY (id),
    CONSTRAINT item_fkey FOREIGN KEY (item) REFERENCES items(id) ON DELETE CASCADE
) TABLESPACE pg_default;

CREATE TABLE item_items
(
    id uuid NOT NULL DEFAULT uuid_generate_v4(),
    item1 uuid NOT NULL,
    item2 uuid NOT NULL,
    relationship integer NOT NULL,
    created_at timestamp without time zone NOT NULL DEFAULT now(),
    CONSTRAINT item_items_pkey PRIMARY KEY (id),
    CONSTRAINT item1_fkey FOREIGN KEY (item1) REFERENCES items(id) ON DELETE CASCADE,
    CONSTRAINT item2_fkey FOREIGN KEY (item2) REFERENCES items(id) ON DELETE CASCADE,
    CONSTRAINT relationship_fkey FOREIGN KEY (relationship) REFERENCES relationships(id) ON DELETE CASCADE
) TABLESPACE pg_default;

CREATE TABLE item_item_properties
(
    id uuid NOT NULL DEFAULT uuid_generate_v4(),
    item_item uuid NOT NULL,
    name character varying NOT NULL,
    value character varying NOT NULL,    
    CONSTRAINT item_item_properties_pkey PRIMARY KEY (id),
    CONSTRAINT item_item_fkey FOREIGN KEY (item_item) REFERENCES item_items(id) ON DELETE CASCADE
) TABLESPACE pg_default;

CREATE TABLE results
(
    id uuid NOT NULL DEFAULT uuid_generate_v4(),
    test uuid NOT NULL,
    item uuid NOT NULL,
    metric integer NOT NULL,
    value float NOT NULL,
    created_at timestamp without time zone NOT NULL DEFAULT now(),
    CONSTRAINT results_pkey PRIMARY KEY (id),
    CONSTRAINT test_fkey FOREIGN KEY (test) REFERENCES tests(id) ON DELETE CASCADE,
    CONSTRAINT item_fkey FOREIGN KEY (item) REFERENCES items(id) ON DELETE CASCADE,
    CONSTRAINT metric_fkey FOREIGN KEY (metric) REFERENCES metrics(id) ON DELETE NO ACTION
) TABLESPACE pg_default;

CREATE TABLE result_properties
(
    id uuid NOT NULL DEFAULT uuid_generate_v4(),
    result uuid NOT NULL,
    name character varying NOT NULL,
    value character varying NOT NULL,    
    CONSTRAINT result_properties_pkey PRIMARY KEY (id),
    CONSTRAINT result_fkey FOREIGN KEY (result) REFERENCES results(id) ON DELETE CASCADE
) TABLESPACE pg_default;

CREATE TABLE operational_profiles
(
    id uuid NOT NULL DEFAULT uuid_generate_v4(),
    project uuid NOT NULL,
    name character varying NOT NULL,
    created_at timestamp without time zone NOT NULL DEFAULT now(),
    CONSTRAINT operational_profiles_pkey PRIMARY KEY (id),
    CONSTRAINT project_fkey FOREIGN KEY (project) REFERENCES projects(id) ON DELETE CASCADE
) TABLESPACE pg_default;

CREATE TABLE operational_profile_observations
(
    id uuid NOT NULL DEFAULT uuid_generate_v4(),
    operational_profile uuid NOT NULL,
    users integer NOT NULL,
    frequency integer NOT NULL,
    CONSTRAINT operational_profile_observations_pkey PRIMARY KEY (id),
    CONSTRAINT operational_profile_fkey FOREIGN KEY (operational_profile) REFERENCES operational_profiles(id) ON DELETE CASCADE
) TABLESPACE pg_default;

