CREATE INDEX items_name ON items (project, name);



CREATE OR REPLACE FUNCTION public.create_or_get_item(_project uuid, _name character varying) RETURNS uuid LANGUAGE 'sql' COST 100 VOLATILE PARALLEL UNSAFE AS $BODY$
SELECT id FROM items WHERE project=_project AND name=_name;
$BODY$;

CREATE OR REPLACE FUNCTION public.create_or_get_project(_name character varying) RETURNS uuid LANGUAGE 'sql' COST 100 VOLATILE PARALLEL UNSAFE AS $BODY$
SELECT id FROM projects WHERE name=_name;
$BODY$;

CREATE OR REPLACE FUNCTION public.create_or_get_test(_project uuid, _name character varying, _created_at timestamp without time zone) RETURNS uuid LANGUAGE 'sql' COST 100 VOLATILE PARALLEL UNSAFE AS $BODY$
SELECT id FROM tests WHERE project = _project AND name = _name;
$BODY$;

CREATE OR REPLACE FUNCTION public.create_or_get_test_set(_project uuid, _name character varying) RETURNS uuid LANGUAGE 'sql' COST 100 VOLATILE PARALLEL UNSAFE AS $BODY$
SELECT id FROM test_sets WHERE project=_project AND name=_name;
$BODY$;

CREATE OR REPLACE FUNCTION public.get_metric(_abbreviation character varying) RETURNS integer LANGUAGE 'sql' COST 100 VOLATILE PARALLEL UNSAFE AS $BODY$
SELECT id FROM metrics WHERE abbreviation=_abbreviation;
$BODY$;

